def my_func(input1: str) -> str:
    if not (1 <= len(input1) <= 100):
        return ""
    max_count = 0
    result = ""
    for i in range(len(input1)):
        for j in range(i + 1, len(input1) + 1):
            substring = input1[i:j]
            count = input1.count(substring)
            if count > max_count or (count == max_count and len(substring) > len(result)):
                max_count = count
                result = substring
    return result
